INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("青空の下で謁見", 5118061, 0, 8, 10118, 1, 40, "フリーマーケット会場", 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, "ペコリーヌとの出会い", 2, 91002, 2834);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("未来の騎空団\nマスコット？", 5118062, 0, 8, 10118, 1, 40, "フリーマーケット会場", 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, "マホとの出会い", 2, 91002, 2835);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("お嬢さまからの\n緊急依頼", 5118063, 0, 8, 10118, 1, 40, "ランドソル市街地", 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, "アキノとの出会い", 2, 91002, 2837);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("黄金色の悩みごと", 5118064, 0, 8, 10118, 1, 40, "フリーマーケット会場", 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, "ジュンとの出会い", 2, 91002, 4108402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("白熱！　格闘大会！", 5118065, 0, 8, 10118, 1, 40, "フリーマーケット会場", 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, "カオリとの出会い", 2, 91002, 4107402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("祭り太鼓はオーエドの華", 5118066, 0, 8, 10118, 1, 40, "オーエド町", 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "ニノンとの出会い", 2, 91002, 9000227);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("人気者は遅れて\nやってくる", 5118067, 0, 8, 10118, 1, 40, "フリーマーケット会場", 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, "スズナとの出会い", 3, 91002, 2101181);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("巫女・ミーツ・魔法少女", 5118068, 0, 8, 10118, 1, 40, "ランドソル市街地", 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, "ナナカとの出会い", 3, 91002, 4109402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ネズ耳は二度なくなる", 5118069, 0, 8, 10118, 1, 40, "フリーマーケット会場", 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, "キャル＆コッコロとの出会い", 3, 91002, 4305402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("この出会いにカンパイ！", 5118070, 0, 8, 10118, 1, 40, "ランドソル市街地", 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, "ユカリとの出会い", 3, 91002, 4101402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("陰陽アンサンブル", 5118071, 0, 8, 10118, 1, 40, "ランドソル市街地", 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, "アオイとの出会い", 3, 91002, 4106402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("運試し十番勝負！", 5118072, 0, 8, 10118, 1, 40, "フリーマーケット会場", 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "シノブとの出会い", 3, 91002, 2836);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("彼女たちの新たな日常", 5118600, 10145115, 0, 10118, 0, 0, 0, 0, 0, 0, "オープニング", 1, 0, 0);
